import React from 'react';
import ListMeal from './pages/ListMeal/index';
import { FilterProvider } from './Context/filtersCtx';
import { MealsProvider } from './Context/mealsCtx'; // No olvides el MealsProvider si es necesario

const App = () => {
  return (
    <MealsProvider>
      <FilterProvider>
        <ListMeal />
      </FilterProvider>
    </MealsProvider>
  );
}

export default App;
